INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES (30, '<font color=\"#0000\"><b>Add Newsletter Menu</font>', 'newsletter', '<font color=\"#CC0000\"><b>Bossthemes</font>', '<b>1.0</b>', 'www.bossthemes.com', '<modification>\r\n   <name><![CDATA[<font color=\"#0000\"><b>Add Newsletter Menu</font>]]></name>\r\n    <version><![CDATA[<b>1.0</b>]]></version>\r\n    <author><![CDATA[<font color=\"#CC0000\"><b>Bossthemes</font>]]></author>\r\n    <link><![CDATA[www.bossthemes.com]]></link>\r\n	<code>newsletter</code>\r\n	<file path=\"admin/controller/common/menu.php\">\r\n		<operation>\r\n			<search><![CDATA[\r\n            $this->load->language(\'common/menu\');\r\n            ]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n            $data[\'text_newssubscribe\'] = $this->language->get(\'text_newssubscribe\');\r\n			$data[\'newssubscribe\'] = $this->url->link(\'sale/newssubscribers\', \'token=\' . $this->session->data[\'token\'], \'SSL\');\r\n            ]]></add>\r\n		</operation>\r\n	</file>\r\n    	<file path=\"admin/language/*/common/menu.php\">\r\n		<operation>\r\n			<search><![CDATA[$_[\'text_system\']                      = \'System\';]]></search>\r\n			<add position=\"after\"><![CDATA[$_[\'text_newssubscribe\']     = \'Newsletter Subscribers\';]]></add>\r\n		</operation>\r\n	</file>\r\n    	<file path=\"admin/controller/marketing/contact.php\">\r\n		<operation>\r\n			<search><![CDATA[\r\n            case \'newsletter\':\r\n            ]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n            $results = $this->model_sale_customer->getNewsletterSubscribers();\r\n\r\n						foreach ($results as $result) {\r\n							$emails[\"s\".$result[\'id\']] = $result[\'email_id\'];\r\n						}\r\n            ]]></add>\r\n		</operation>\r\n	</file>\r\n    <file path=\"admin/model/sale/customer.php\">\r\n		<operation>\r\n			<search><![CDATA[\r\n            class ModelSaleCustomer extends Model {\r\n            ]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n            public function getNewsletterSubscribers() {\r\n		$query = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"subscribe\");\r\n\r\n		return $query->rows;\r\n	}\r\n            ]]></add>\r\n		</operation>\r\n	</file>\r\n    <file path=\"admin/view/template/common/menu.tpl\">\r\n		<operation>\r\n			<search><![CDATA[\r\n            <li><a href=\"<?php echo $contact; ?>\"><?php echo $text_contact; ?></a></li>\r\n            ]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n            <li><a href=\"<?php echo $newssubscribe; ?>\"><?php echo $text_newssubscribe; ?></a></li>\r\n            ]]></add>\r\n		</operation>\r\n	</file>\r\n</modification>', 1, '2014-12-09 10:27:04');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES (37, '<font color=\"#0000\"><b>Get Image Sub-Category</font>', 'getimagesubcategories', '<font color=\"#CC0000\"><b>Bossthemes</font>', '<b>1.0</b>', 'http://www.bossthemes.com', '<modification>\r\n   <name><![CDATA[<font color=\"#0000\"><b>Get Image Sub-Category</font>]]></name>\r\n    <version><![CDATA[<b>1.0</b>]]></version>\r\n    <author><![CDATA[<font color=\"#CC0000\"><b>Bossthemes</font>]]></author>\r\n    <link><![CDATA[http://www.bossthemes.com]]></link>\r\n	<code>getimagesubcategories</code>\r\n	<file path=\"catalog/controller/product/category.php\">\r\n		<operation>\r\n			<search><![CDATA[\r\n            \'name\'  => $result[\'name\'] . ($this->config->get(\'config_product_count\') ? \' (\' . $this->model_catalog_product->getTotalProducts($filter_data) . \')\' : \'\'),\r\n            ]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n            \'thumb\'  => $this->model_tool_image->resize((isset($result[\'image\'])&&!empty($result[\'image\']))?$result[\'image\']:\'icon_default.png\', 40, 40),\r\n            ]]></add>\r\n		</operation>\r\n	</file>\r\n</modification>', 1, '2015-01-27 10:47:36');
