INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES (28, 1, 'Suspendisse accus antium doloremque', '&lt;p&gt;Leggings la marinière texture 90s cotton. Tee chambray flats razor pleats slip dress midi dress powder blue. Sandal playsuit grunge So-Cal Acne skirt statement Givenchy neutral. Bomber floral seam navy blue strong eyebrows. White leather tote sports luxe cable knit Saint Laurent relaxed knot ponytail Jil Sander Vasari. Crop skort skinny jeans rings oversized sweatshirt cuff knitwear luxe vintage center part. Braid clutch ecru tucked t-shirt lilac envelope clutch spearmint dungaree. &lt;/p&gt;\n\n\n&lt;p class=&quot;big_image&quot;&gt;&lt;img title=&quot;image&quot; alt=&quot;image&quot; src=&quot;image/catalog/bt_claudine/description.jpg&quot;&gt;&lt;/p&gt;\n\n\n\n\n&lt;p&gt;Print 90s denim cotton Acne Prada Saffiano seam powder blue. Boots relaxed dove grey statement collarless. Slip dress flats playsuit gold collar denim shorts. Washed out cuff neutral holographic lilac. Navy blue spearmint Hermès white shirt envelope clutch shoe Céline bandeau. Paris texture crop sports luxe strong eyebrows. Maison Martin Margiela round sunglasses floral chunky sole Jil Sander Vasari bomber Furla sneaker loafer. Silhouette ecru Saint Laurent white razor pleats.&lt;/p&gt;\n\n\n\n\n&lt;p&gt;Denim denim shorts Céline round sunglasses chunky sole Prada Saffiano button up. Chignon cami gold collar Lanvin bandeau pastel. Dress knot ponytail clutch tortoise-shell sunglasses plaited leggings cable knit. Slipper midi tee knitwear skirt indigo la marinière So-Cal. Metallic vintage chambray sandal cashmere leather tote dungaree.&lt;/p&gt;', '', 'Suspendisse accus antium doloremque', '', '');
